CREATE TABLE Users(
    `Id` INT NOT NULL PRIMARY KEY,
    `UserName` TEXT,
    `Email` TEXT,
    `PhoneNumber` INT,
    `Password` TEXT,
    `JoinDate` DATE
);
CREATE TABLE Friends(
    `IdUser` INT NOT NULL,
    `IdFriend` INT
);
CREATE TABLE Profile_Settings(
    `IdUser` INT NOT NULL PRIMARY KEY,
    `ShoedName` TEXT,
    `Pronouns` TEXT,
    `BannerColour` TEXT,
    `AbautMe` TEXT
);
CREATE TABLE Servers(
    `Id` INT NOT NULL PRIMARY KEY,
    `Name` TEXT,
    `IdOwner` TEXT,
    `CreateDate` DATE,
    `Level` INT
);
CREATE TABLE ServerMembers(
    `IdServer` INT NOT NULL,
    `IdUser` INT
);
CREATE TABLE Chat(
    `IdChat` INT NOT NULL PRIMARY KEY,
    `ChatName` TEXT,
    `Owner` INT
);
CREATE TABLE ChatMembers(
    `IdChat` INT NOT NULL,
    `IdUser` INT
);
CREATE TABLE ChatMessages(
    `IdMessage` INT NOT NULL PRIMARY KEY,
    `IdSender` INT,
    `IdChat` INT,
    `Message` TEXT,
    `SendDate` DATETIME
);
CREATE TABLE ServerChannels(
    `IdChannel` INT NOT NULL PRIMARY KEY,
    `IdGroup` INT,
    `Name` TEXT,
    `Topic` TEXT,
    `Private` BOOLEAN
);
CREATE TABLE ServerGroup(
    `IdGroup` INT NOT NULL PRIMARY KEY,
    `Name` TEXT,
    `Private` BOOLEAN,
    `IdServer` INT
);
CREATE TABLE ServerMessages(
    `IdMessage` INT NOT NULL PRIMARY KEY,
    `IdChannel` INT,
    `IdSender` INT,
    `SendDate` DATETIME,
    `Message` TEXT
);

